def get_indexer(
        self,
        target: AnyArrayLike,
        method: Optional[str] = None,
        limit: Optional[int] = None,
        tolerance: Optional[Any] = None,
    ) -> np.ndarray:

        self._check_method(method)

        if self.is_overlapping:
            msg = (
                "cannot handle overlapping indices; use "
                "IntervalIndex.get_indexer_non_unique"
            )
            raise InvalidIndexError(msg)

        target_as_index = ensure_index(target)

        if isinstance(target_as_index, IntervalIndex):
            if self.equals(target_as_index):
                return np.arange(len(self), dtype="intp")

            # Process IntervalIndex values
            indexer = np.full(len(target_as_index), -1, dtype='intp')
            for i in range(len(target_as_index)):
                left_idx = self.left.get_loc(target_as_index.left[i])
                right_idx = self.right.get_loc(target_as_index.right[i])
                if left_idx != -1 and right_idx != -1 and left_idx == right_idx:
                    indexer[i] = left_idx
        else:
            # Handle non-IntervalIndex values
            indexer = np.full(len(target_as_index), -1, dtype='intp')
            for i in range(len(target_as_index)):
                try:
                    loc = self.get_loc(target_as_index[i])
                    indexer[i] = loc
                except KeyError:
                    pass

        return indexer
